package com.js.springmvc2;

public class Data {
	
	private int x;
	private int y;
	
	public Data() {
		// TODO Auto-generated constructor stub
	}

	public Data(int x, int y) {
		super();
		this.x = x;
		this.y = y;
	}

	public int getX() {
		return x;
	}

	public void setX(int x) {
		this.x = x;
	}

	public int getY() {
		return y;
	}

	public void setY(int y) {
		this.y = y;
	}
}
